const filterCars = (selectedCategory, selectedSubCategory, cars) => {
    if (selectedCategory === "" && selectedSubCategory === "") {
      return cars;
    }

    return cars.filter(
      (car) =>
        car.category === selectedCategory && car.seats === selectedSubCategory
    );
  };

  export default filterCars;
